-- ----------------------------
-- View structure for lista_empleados
-- ----------------------------
DROP VIEW IF EXISTS `lista_empleados`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `lista_empleados` AS SELECT e.id_empleado, 
e.nr AS nr_empleado, 
CONCAT_WS(' ',e.primer_nombre, e.segundo_nombre, e.tercer_nombre, e.primer_apellido, e.segundo_apellido, e.apellido_casada) AS nombre_empleado, 
COALESCE(g.id_genero, '(NO HAY REGISTRO)') AS id_genero,
COALESCE(g.genero, '(NO HAY REGISTRO)') AS genero,
CASE 
WHEN e.fecha_nacimiento NOT LIKE '0000-00-00' 
	THEN CONCAT_WS(' ',TIMESTAMPDIFF(YEAR,e.fecha_nacimiento,CURRENT_DATE),'AÑOS') 
	ELSE '(NO HAY REGISTRO)'
END AS edad_empleado,
COALESCE(o.id_seccion, '(NO HAY REGISTRO)') AS id_seccion, 
COALESCE(o.nombre_seccion, '(NO HAY REGISTRO)') AS seccion, 
COALESCE(o2.nombre_seccion, '(NO HAY REGISTRO)') AS id_seccion_padre, 
COALESCE(o2.nombre_seccion, '(NO HAY REGISTRO)') AS seccion_padre, 
CASE 
WHEN i2.fecha_inicio NOT LIKE '0000-00-00' 
	THEN DATE_FORMAT(i2.fecha_inicio,'%d/%m/%Y') 
	ELSE '(NO HAY REGISTRO)'
END AS fecha_inicio_cargo_actual, 
CASE 
WHEN i2.fecha_inicio NOT LIKE '0000-00-00' 
	THEN CONCAT_WS(' ',TIMESTAMPDIFF(YEAR,i2.fecha_inicio,CURRENT_DATE),'AÑOS') 
	ELSE '(NO HAY REGISTRO)'
END AS tiempo_cargo_actual,
COALESCE(f.id_cargo_funcional, '(NO HAY REGISTRO)') AS id_cargo_funcional,
COALESCE(f.funcional, '(NO HAY REGISTRO)') AS cargo_funcional, 
COALESCE(f.id_nivel, '(NO HAY REGISTRO)') AS nivel_funcional, 
COALESCE(n.id_cargo_nominal, '(NO HAY REGISTRO)') AS id_cargo_nominal,
COALESCE(n.cargo_nominal, '(NO HAY REGISTRO)') AS cargo_nominal, 
COALESCE(n.id_nivel, '(NO HAY REGISTRO)') AS nivel_nominal
FROM sir_empleado_informacion_laboral AS i 
INNER JOIN tcm_empleado_informacion_laboral AS i2 ON i2.id_empleado=i.id_empleado AND i2.fecha_inicio like i.fecha_inicio
LEFT JOIN org_seccion AS o ON o.id_seccion=i.id_seccion
LEFT JOIN org_seccion AS o2 ON o2.id_seccion=o.depende
LEFT JOIN sir_cargo_funcional AS f ON f.id_cargo_funcional=i.id_cargo_funcional
LEFT JOIN sir_cargo_nominal AS n ON n.id_cargo_nominal=i.id_cargo_nominal
RIGHT JOIN sir_empleado AS e ON e.id_empleado=i2.id_empleado
RIGHT JOIN org_genero AS g ON g.id_genero=e.id_genero
LEFT JOIN org_usuario AS u ON u.nr like e.nr
GROUP BY e.id_empleado
ORDER BY e.id_empleado ;

