-- View structure for tcm_empleado
-- ----------------------------
DROP VIEW IF EXISTS `tcm_empleado`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost`  VIEW `tcm_empleado` AS SELECT e.id_empleado, e.nr, LOWER(CONCAT_WS(' ',e.primer_nombre, e.segundo_nombre, e.tercer_nombre, e.primer_apellido, e.segundo_apellido, e.apellido_casada)) AS nombre, e.correo, u.id_usuario, u.usuario, o.id_seccion, LOWER(COALESCE(o.nombre_seccion, '(NO HAY REGISTRO)')) seccion, o2.id_seccion AS id_padre, LOWER(COALESCE(o2.nombre_seccion, '(NO HAY REGISTRO)')) padre, o3.id_seccion AS id_abuelo, LOWER(COALESCE(o3.nombre_seccion, '(NO HAY REGISTRO)')) abuelo, o4.id_seccion AS id_bisabuelo, LOWER(COALESCE(o4.nombre_seccion, '(NO HAY REGISTRO)')) bisabuelo, o5.id_seccion AS id_tatarabuelo, LOWER(COALESCE(o5.nombre_seccion, '(NO HAY REGISTRO)')) tatarabuelo, i2.fecha_inicio, LOWER(COALESCE(f.funcional, '(NO HAY REGISTRO)')) funcional, LOWER(COALESCE(n.cargo_nominal, '(NO HAY REGISTRO)')) nominal 
FROM sir_empleado_informacion_laboral AS i 
INNER JOIN tcm_empleado_informacion_laboral AS i2 ON i2.id_empleado=i.id_empleado AND i2.fecha_inicio like i.fecha_inicio
LEFT JOIN org_seccion AS o ON o.id_seccion=i.id_seccion
LEFT JOIN org_seccion AS o2 ON o2.id_seccion=o.depende
LEFT JOIN org_seccion AS o3 ON o3.id_seccion=o2.depende
LEFT JOIN org_seccion AS o4 ON o4.id_seccion=o3.depende
LEFT JOIN org_seccion AS o5 ON o5.id_seccion=o4.depende
LEFT JOIN sir_cargo_funcional AS f ON f.id_cargo_funcional=i.id_cargo_funcional
LEFT JOIN sir_cargo_nominal AS n ON n.id_cargo_nominal=i.id_cargo_nominal
RIGHT JOIN sir_empleado AS e ON e.id_empleado=i2.id_empleado
LEFT JOIN org_usuario AS u ON u.nr like e.nr
GROUP BY e.id_empleado
ORDER BY e.id_empleado ;

