-- ----------------------------
-- Function structure for buscar_seccion
-- ----------------------------
DROP FUNCTION IF EXISTS `buscar_seccion`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `buscar_seccion`( id_emp INT ) RETURNS int(11)
BEGIN
 
  DECLARE id_sec INT;
  DECLARE fec_ini DATE;
  DECLARE cur1 CURSOR FOR SELECT
														sir_empleado_informacion_laboral.id_seccion,
														sir_empleado_informacion_laboral.fecha_inicio
														FROM sir_empleado_informacion_laboral
														WHERE sir_empleado_informacion_laboral.id_empleado=id_emp
														GROUP BY sir_empleado_informacion_laboral.id_empleado_informacion_laboral
														HAVING sir_empleado_informacion_laboral.fecha_inicio >= ALL(SELECT
																sir_empleado_informacion_laboral.fecha_inicio
																FROM sir_empleado_informacion_laboral
																WHERE sir_empleado_informacion_laboral.id_empleado=id_emp
																GROUP BY sir_empleado_informacion_laboral.id_empleado,sir_empleado_informacion_laboral.fecha_inicio) ;
 
 
   OPEN cur1; myLoop: LOOP
 
			FETCH cur1 INTO id_sec, fec_ini;
    
   END LOOP;
 
		RETURN 1; 
 
    END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for F03
-- ----------------------------
DROP FUNCTION IF EXISTS `F03`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `F03`( arg_id INT ) RETURNS varchar(500) CHARSET utf8
BEGIN
 
  DECLARE done BOOL DEFAULT FALSE;
  DECLARE a INT;
  DECLARE b INT;
  DECLARE c INT;
  DECLARE d INT;
  DECLARE rowid INT;
  DECLARE total INT;
  DECLARE cur1 CURSOR FOR SELECT id , nota1 , nota2 , nota3 from nota where id=arg_id;
  DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done = TRUE;
 
  set total = 0;
 
   OPEN cur1; myLoop: LOOP
 
   FETCH cur1 INTO rowid , a, b, c;
     set d = a + b + c;
     update nota set final=d where id=rowid;
 
 
     IF done THEN
      CLOSE cur1;
      LEAVE myLoop;
     END IF;
 
    set total = total + 1;
   END LOOP;
 
    IF TOTAL=1 THEN
     RETURN concat(' Se actualizaron ' , total , ' registros, ID= ', arg_id , ' , NotaFinal= ',d);
    ELSE
     RETURN concat(' No Se actualizaron registros');
    END IF;
 
 
    END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for initcap
-- ----------------------------
DROP FUNCTION IF EXISTS `initcap`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `initcap`(cadena VARCHAR(100)) RETURNS varchar(100) CHARSET utf8
BEGIN 
DECLARE pos INT DEFAULT 0; 
DECLARE tmp VARCHAR(100) DEFAULT ''; 
DECLARE result VARCHAR(100) DEFAULT ''; 
REPEAT SET pos = LOCATE(' ', cadena); 
 IF pos = 0 THEN SET pos = CHAR_LENGTH(cadena); 
 END IF; 
 SET tmp = LEFT(cadena,pos); 
 SET result = CONCAT(result, UPPER(LEFT(tmp,1)),SUBSTR(tmp,2)); 
 SET cadena = RIGHT(cadena,CHAR_LENGTH(cadena)-pos); 
UNTIL CHAR_LENGTH(cadena) = 0 END REPEAT; 
RETURN result; 
END
;;
DELIMITER ;
